    obj.fileName = Random.cword(5, 10) + Random.pick(['.jpg', '.zip', '.txt', '.pdf']);
    obj.placeId = Random.string('upper', 3) + Random.integer(10000, 99999);
    obj.equipmentNumber = Random.string('lower', 24);
    obj.fileSource = Random.integer(1, 2);
    obj.platform = Random.integer(1, 2);
    obj.updateTime = Random.datetime();
    GetFileUploadList.push(obj);
}

var GetPushExceptionFileList = [];
