    obj.clientIp = Random.ip();
    obj.systemVersion = "SystemVersion";
    obj.operatingSystemType = "operatingSystemType";
    obj.operatingSystemVersion = "operatingSystemVersion";
    obj.updateTime = Random.datetime();
    GetLogisticsFileUploadLogList.push(obj);
}

var GetPushOEMFileList = [];
for (let index = 0; index < 10; index++) {
