    obj.updateTime = Random.datetime();
    GetPushOEMFileList.push(obj);
}

var GetFileDownloadList = [];
for (let index = 0; index < 10; index++) {
    let obj = {};
    obj.fileName = Random.cword(5, 10) + Random.pick(['.jpg', '.zip', '.txt', '.pdf']);
    obj.fileType = Random.integer(1, 4);
    obj.updateTime = Random.datetime();
    GetFileDownloadList.push(obj);
}

var GetApiSystemList = [];
for (let index = 0; index < 10; index++) {
    let obj = {};
    obj.url = '/' + Random.string("lower",8)+'/' + Random.string("lower",12);
    obj.requestContent = Random.string('lower',100);
    obj.clientIp = Random.ip();
    obj.token = Random.guid();
    obj.placeId = Random.string('upper', 3) + Random.integer(10000, 99999);
    obj.createTime = Random.datetime();
    GetApiSystemList.push(obj);
}

